Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (1,'Blood Test','Evaluates overall health, detects disorders like anemia, infection. Measures blood components like RBCs, WBCs, platelets.',500);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (2,'X-Ray Examination','Produces images of body interior using electromagnetic radiation. Diagnoses fractures, pneumonia, tumors.',1000);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (3,'Urine Analysis','Examines urine content to diagnose urinary tract infections, kidney disease, diabetes. Evaluates pH, specific gravity, components.',300);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (4,'MRI Scan','Uses magnets, radio waves to create detailed body images. Diagnoses tumors, brain injuries, spinal cord disorders.',1500);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (5,'Electrocardiogram (ECG)','Measures heart electrical activity to diagnose arrhythmias, heart attacks, heart failure.',800);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (6,'Fecal Occult Blood Test (FOBT)','Screens for hidden blood in stool. Diagnoses colorectal cancer, GI bleeding, IBD.',400);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (7,'Spirometry Test','Measures air amount, speed in lungs. Diagnoses asthma, COPD, interstitial lung disease.',600);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (8,'Thyroid Function Test (TFT)','Measures thyroid hormone levels. Diagnoses hypothyroidism, hyperthyroidism, thyroid cancer.',700);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (9,'Skin Allergy Test','Identifies allergens causing reactions. Diagnoses allergic rhinitis, eczema, food allergies.',350);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (10,'Liver Function Test (LFT)','Measures liver enzyme, protein levels. Diagnoses hepatitis, cirrhosis, fatty liver disease.',900);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (11,'Electroencephalogram (EEG)','Measures brain electrical activity. Diagnoses epilepsy, sleep disorders, brain tumors.',1200);
Insert into HR.TEST (TEST_ID,TYPE,DESCRIPTION,COST) values (12,'Bone Density Test','Measures bone strength, density. Diagnoses osteoporosis, assesses fracture risk.',1000);
